import React, { useEffect, useRef } from "react";
import "../styles/Home.css"; // Ensure this path is correct

const Home = () => {
  const gradientRef = useRef(null);

  useEffect(() => {
    const handleMouseMove = (e) => {
      if (!gradientRef.current) return;

      const { innerWidth, innerHeight } = window;
      const x = (e.clientX / innerWidth) * 100;
      const y = (e.clientY / innerHeight) * 100;

      gradientRef.current.style.backgroundPosition = `${x}% ${y}%`;
    };

    window.addEventListener("mousemove", handleMouseMove);
    return () => window.removeEventListener("mousemove", handleMouseMove);
  }, []);

  return (
    <div
      ref={gradientRef}
      className="interactive-gradient flex flex-col items-center justify-start min-h-screen text-center px-6 font-sans"
      style={{ backgroundSize: "200% 200%" }}
    >
      {/* Hero Section */}
      <section className="flex flex-col items-center justify-center h-screen w-full">
        <h1 className="text-5xl md:text-6xl font-bold text-white mb-4 tracking-tight animate-fadeInDown">
          Welcome to <span className="text-indigo-400">GitWing</span>
        </h1>
        <p className="text-lg md:text-xl text-gray-200 mb-8 animate-fadeInUp">
          Your personal GitHub dashboard & PR analyzer — visualize, track, and manage your repositories effortlessly.
        </p>
        <div className="flex gap-4">
          <a href="http://localhost:5000/auth/github">
            <button className="px-8 py-3 text-lg font-medium rounded-xl bg-indigo-600 text-white shadow-md hover:bg-indigo-700 hover:shadow-lg transition duration-300 animate-bounce">
              Login with GitHub
            </button>
          </a>
          <a href="#features">
            <button className="px-8 py-3 text-lg font-medium rounded-xl border border-white text-white hover:bg-white hover:text-black transition duration-300 animate-bounce">
              Learn More
            </button>
          </a>
        </div>
      </section>

      {/* Features Section */}
      <section
        id="features"
        className="w-full py-20 flex flex-col items-center justify-center gap-16"
      >
        <h2 className="text-4xl md:text-5xl font-bold text-white mb-12">
          Why GitWing?
        </h2>
        <div className="grid gap-10 md:grid-cols-3 w-full max-w-6xl">
          <div className="feature-card p-6 rounded-2xl bg-white/10 backdrop-blur shadow-lg transform hover:scale-105 transition duration-300">
            <h3 className="text-xl font-semibold text-white mb-3">Track Repositories</h3>
            <p className="text-gray-200 text-sm">
              See all your GitHub repositories in one dashboard, with stars, forks, and watcher stats at a glance.
            </p>
          </div>
          <div className="feature-card p-6 rounded-2xl bg-white/10 backdrop-blur shadow-lg transform hover:scale-105 transition duration-300">
            <h3 className="text-xl font-semibold text-white mb-3">Analyze PRs</h3>
            <p className="text-gray-200 text-sm">
              Quickly view all pull requests with status, creators, and creation date — sort or search instantly.
            </p>
          </div>
          <div className="feature-card p-6 rounded-2xl bg-white/10 backdrop-blur shadow-lg transform hover:scale-105 transition duration-300">
            <h3 className="text-xl font-semibold text-white mb-3">Stay Productive</h3>
            <p className="text-gray-200 text-sm">
              Save time by managing your repositories efficiently with modern UI and smart organization.
            </p>
          </div>
        </div>
      </section>

      {/* Call to Action Section */}
      <section className="w-full py-20 flex flex-col items-center justify-center gap-6">
        <h2 className="text-4xl md:text-5xl font-bold text-white mb-4">
          Ready to Get Started?
        </h2>
        <p className="text-gray-200 text-lg mb-6">
          Connect your GitHub account and start managing your projects like a pro.
        </p>
        <a href="http://localhost:5000/auth/github">
          <button className="px-10 py-4 text-lg font-semibold rounded-xl bg-indigo-600 text-white shadow-md hover:bg-indigo-700 hover:shadow-lg transition duration-300 animate-bounce">
            Login with GitHub
          </button>
        </a>
      </section>

      <style>
        {`
          @keyframes fadeInDown {
            0% { opacity: 0; transform: translateY(-30px); }
            100% { opacity: 1; transform: translateY(0); }
          }
          @keyframes fadeInUp {
            0% { opacity: 0; transform: translateY(30px); }
            100% { opacity: 1; transform: translateY(0); }
          }
          .animate-fadeInDown { animation: fadeInDown 1s ease forwards; }
          .animate-fadeInUp { animation: fadeInUp 1s ease forwards; }
          .animate-bounce { animation: bounce 2s infinite; }
          @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-8px); }
          }
        `}
      </style>
    </div>
  );
};

export default Home;
